For day 3 #abryogaquest our affirmation is "I have the power to say yes or no." I post the things I like and don't always stick to yoga on this account. It's my page and my practice, and I can do whatever I want. I am thinking of the anxiety I have felt over not offending people with my nude yoga.. how much is too revealing, will this make someone uncomfortable? Or maybe it shows too much and I will be objectified. I can't control how others choose to interpret my photos, but I do know my intent, and that is to inspire others to be comfortable in their own skin and to love and take pride in their bodies. I celebrate my yoga body; I love my yoga body. I have the power to say yes or no. I get to choose what I want to share, and others have the choice to unfollow if they don't like it and get blocked if they choose to cross a line with inappropriate comments. I choose to spread love and light, and I choose to bathe in positivity while letting any negative reactions go. This is my practice, and in it I am all that matters. #vrksasana #treepose #nakedyoga #nudeyoga #clothesfreeyoga #bodypositiveyoga #ilovemyyogabody #yogaart #bodyart #lovetheskinyourein #powertotheshe
